import { useState, useContext } from "react";
import { MenuContext } from "../../context/MenuContext";
import { Link } from "react-router-dom";

const MenuList = () => {
    const { setMenuText } = useContext(MenuContext);
    const [isProjectHovered, setIsProjectHovered] = useState(false);
    const [isWorkHovered, setIsWorkHovered] = useState(false);
    const [isContactHovered, setIsContactHovered] = useState(false);
    const [isAboutHovered, setIsAboutHovered] = useState(false);
    const [isSkillHovered, setIsSkillHovered] = useState(false);

    const handleProjectHover = () => {
        setIsProjectHovered(true);
    }
    const handleProjectHoverExit = () => {
        setIsProjectHovered(false);
    }
    const handleWorkHover = () => {
        setIsWorkHovered(true);
    }
    const handleWorkHoverExit = () => {
        setIsWorkHovered(false);
    }
    const handleContactHover = () => {
        setIsContactHovered(true);
    }
    const handleContactHoverExit = () => {
        setIsContactHovered(false);
    }
    const handleAboutHover = () => {
        setIsAboutHovered(true);
    }
    const handleAboutHoverExit = () => {
        setIsAboutHovered(false);
    }
    const handleSkillHover = () => {
        setIsSkillHovered(true);
    }
    const handleSkillHoverExit = () => {
        setIsSkillHovered(false);
    }
    return (
        <div className="MenuList">
            <div className="MenuList__container">
                <Link to="/" onMouseEnter={handleProjectHover} onMouseLeave={handleProjectHoverExit}>
                    <div className="MenuList__item">
                        <div className="MenuList__item__text">
                            <h3 className="MenuList__item__text__title">
                                {isProjectHovered ? "Projects" : "Projects"}
                            </h3>
                            <p className="MenuList__item__text__description">
                                {isProjectHovered ? "View my projects" : "View my projects"}
                            </p>
                        </div>
                        <div className="MenuList__item__icon">
                            My Projects
                        </div>
                    </div>
                </Link>
                <Link to="/work" onMouseEnter={handleWorkHover} onMouseLeave={handleWorkHoverExit}>
                    <div className="MenuList__item">
                        <div className="MenuList__item__text">
                            <h3 className="MenuList__item__text__title">
                                {isWorkHovered ? "Work" : "Work"}
                            </h3>
                            <p className="MenuList__item__text__description">
                                {isWorkHovered ? "View my work" : "View my work"}
                            </p>
                        </div>
                        <div className="MenuList__item__icon">
                            Work
                        </div>
                    </div>
                </Link>
                <Link to="/contact" onMouseEnter={handleContactHover} onMouseLeave={handleContactHoverExit}
                >
                    <div className="MenuList__item">
                        <div className="MenuList__item__text">
                            <h3 className="MenuList__item__text__title">
                                {isContactHovered ? "Contact" : "Contact"}
                            </h3>
                            <p className="MenuList__item__text__description">
                                {isContactHovered ? "Contact me" : "Contact me"}
                            </p>
                        </div>
                        <div className="MenuList__item__icon">
                            Contact Me
                        </div>
                    </div>
                </Link>
                <Link to="/about" onMouseEnter={handleAboutHover} onMouseLeave={handleAboutHoverExit}>
                    <div className="MenuList__item">
                        <div className="MenuList__item__text">
                            <h3 className="MenuList__item__text__title">
                                {isAboutHovered ? "About" : "About"}
                            </h3>
                            <p className="MenuList__item__text__description">
                                {isAboutHovered ? "About me" : "About me"}
                            </p>
                        </div>
                        <div className="MenuList__item__icon">
                            About Me
                        </div>
                    </div>
                </Link>
                <Link to="/skills" onMouseEnter={handleSkillHover} onMouseLeave={handleSkillHoverExit}>
                    <div className="MenuList__item">
                        <div className="MenuList__item__text">
                            <h3 className="MenuList__item__text__title">
                                {isSkillHovered ? "Skills" : "Skills"}
                            </h3>
                            <p className="MenuList__item__text__description">
                                {isSkillHovered ? "View my skills" : "View my skills"}
                            </p>
                        </div>
                        <div className="MenuList__item__icon">
                            My Skills
                        </div>
                    </div>
                </Link>
            </div>
        </div>
    );
}

export default MenuList;
